import React from 'react';

const Login = () => {
  return (
    <>
    <section id='login-section'>
      <div className="contact-us">
       <h1 className='text-center text-black text-3xl' >contact us</h1>
       <form action="/">
        <div className="username">
          <input type="text" placeholder='          <label htmlFor="username">message</label>
          '/>
        </div>
        <div className="Email">
          <input type="text" />
        </div>
        <div className="username">
          <input type="text" />
        </div>
       </form>
      </div>
    </section>
    </>
  );
}

export default Login;

